import { useEffect, useState } from "react";
import {
    BrowserRouter,
    Routes,
    Route,
    Link
} from "react-router-dom";
import axios from 'axios'



function Main() {
    const [user, setUser] = useState([])

    useEffect(async () => {
        const resp = await axios.get("https://jsonplaceholder.typicode.com/users")
        setUser(resp.data)

    }, [])

    return (
        <div>
            <Link to="/">Home</Link>

            <BrowserRouter>


                <Routes>
                    <Route path="/" element={<App />} />


                </Routes>
            </BrowserRouter>
        </div>





    )
}
export default Main
